import 'package:intl/intl.dart';
import 'package:intl/message_lookup_by_library.dart';

final messages = new MessageLookup();

typedef String MessageIfAbsent(String messageStr, List<dynamic> args);

class MessageLookup extends MessageLookupByLibrary {
  String get localeName => 'es';

  final messages = _notInlinedMessages(_notInlinedMessages);
  static _notInlinedMessages(_) => <String, Function> {
    "card0" : MessageLookupByLibrary.simpleMessage("DERECHO: Principios, inocencia, espontaneidad, un espíritu libre\n\nINVERTIDA: Retención, imprudencia, toma de riesgos\n\nEl Loco está numerado 0 - el número de potencial ilimitado - y por lo tanto no tiene un lugar específico en la secuencia de las cartas del Tarot. El Loco se puede colocar al principio de los Arcanos Mayores o al final. Los Arcanos Mayores a menudo se consideran el viaje del Loco por la vida y, como tal, siempre está presente y, por lo tanto, no necesita número.\n\nEn la carta del Tarot El Loco se depicta un joven que se para al borde de un acantilado, sin preocuparse del mundo, mientras se embarca en una nueva aventura. Está mirando hacia el cielo (y al Universo) y aparentemente no sabe que está a punto de saltar un precipicio hacia lo desconocido. Sobre su hombro descansa una mochila modesta que contiene todo lo que necesita, lo cual no es mucho (digamos que es un minimalista). La rosa blanca en su mano izquierda representa su pureza e inocencia. Y a sus pies hay un pequeño perro blanco, representa lealtad y protección, eso lo alienta a seguir adelante y aprender las lecciones que vivencia. Las montañas detrás del Loco simbolizan los desafíos por venir. Están siempre presentes, pero al Loco no le importan en este momento; está más concentrado en comenzar su expedición."),
    "card1" : MessageLookupByLibrary.simpleMessage("DERECHO: Manifestación, ingenio, poder, acción inspirada\n\nINVERTIDA: Manipulación, mala planificación, talentos sin explotar\n\nLa carta del Mago tiene el número Uno, el número de nuevos comienzos y oportunidades, y se asocia con el planeta Mercurio. Se para con un brazo extendido hacia el Universo, y el otro apuntando hacia la tierra. Su posición representa su conexión entre los reinos espirituales y los reinos materiales. El Mago usa esta relación para crear y manifestar sus objetivos en el ámbito físico. Él es el conducto que convierte la energía en materia. La túnica del Mago es blanca, simboliza la pureza, y su capa es roja, lo que representa la experiencia y conocimiento mundano.\n\nEn la mesa frente a él están los cuatro símbolos de los trajes del Tarot: copa, oro, espada y bastos, cada uno de los cuales simboliza uno de los cuatro elementos: agua, tierra, aire y fuego. También es una señal de que tiene todas las herramientas (y elementos) que necesita para manifestar sus intenciones. Sobre su cabeza está el símbolo del infinito, y alrededor de su cintura hay una serpiente que se muerde la cola, lo que indica que tiene acceso a un potencial ilimitado. Y en primer plano hay una variedad de follaje y flores, que simboliza el florecimiento y la fructificación de sus ideas y aspiraciones."),
    "card10" : MessageLookupByLibrary.simpleMessage("DERECHO: Buena suerte, karma, ciclos de vida, destino, un punto de inflexión\n\nINVERTIDA: Mala suerte, resistencia al cambio, ciclos de ruptura\n\nLa carta Rueda de la Fortuna muestra una rueda gigante, con tres figuras en los bordes exteriores. Cuatro letras hebreas, YHVH (Yod Heh Vau Heh), el nombre impronunciable de Dios, están inscritas en la cara de la rueda. También están las letras TORA, que se cree que es una versión de la palabra Torá, que significa \"ley\", o TAROT, o incluso ROTA (en latín, \"rueda\"). La rueda central tiene los símbolos alquímicos para mercurio, azufre, agua y sal, los componentes básicos de la vida y los cuatro elementos, y representa el poder formativo.\n\nEn el círculo exterior hay una serpiente, el dios egipcio Typhon (el dios del mal), que desciende del lado izquierdo. La serpiente también representa la fuerza vital que se hunde en el mundo material. En el lado derecho se levanta Anubis, el dios egipcio de los muertos que da la bienvenida a las almas al inframundo. Y en la parte superior de la rueda se encuentra la Esfinge, que representa el conocimiento y la fuerza.\n\nEn las esquinas de la Rueda de la Fortuna hay cuatro criaturas aladas, cada una asociada con los cuatro signos fijos del zodíaco: el ángel es Acuario, el águila es Escorpio, el león es Leo y el toro es Tauro. Sus alas significan estabilidad en medio del movimiento y el cambio, y cada una sostiene la Torá, que representa la sabiduría."),
    "card11" : MessageLookupByLibrary.simpleMessage("DERECHO: Justicia, equidad, verdad, causa y efecto, ley\n\nINVERTIDA: Injusticia, falta de responsabilidad, deshonestidad\n\nLa figura de La Justicia se sienta frente a un velo púrpura flojo, que significa compasión, y entre dos pilares, similares a los que enmarcan a la Suma Sacerdotisa y al Hierofante, que simbolizan el equilibrio, la ley y la estructura.\n\nElla sostiene una espada en su mano derecha, mostrando la mentalidad lógica y bien ordenada necesaria para dispensar justicia justa. La espada apunta hacia arriba, expresando una decisión firme y final, y la hoja de doble filo significa que nuestras acciones siempre tienen consecuencias. Las escalas en su mano izquierda (intuitiva) muestran que la intuición debe equilibrar esa lógica y son un símbolo de su imparcialidad. La Justicia lleva una corona con un pequeño cuadrado que representa pensamientos bien ordenados y una túnica roja con un manto verde. Un pequeño zapato blanco sale de debajo de su ropa como un recordatorio de las consecuencias espirituales de tus acciones."),
    "card12" : MessageLookupByLibrary.simpleMessage("DERECHO: Pausa, rendición, dejar ir, nuevas perspectivas\n\nINVERTIDA: Retrasos, resistencia, estancamiento, indecisión\n\nEl Colgado muestra a un hombre suspendido de una cruz en forma de T hecha de madera viva. Está colgado boca abajo, viendo el mundo desde una perspectiva completamente diferente, y su expresión facial es tranquila y serena, lo que sugiere que está en esta posición colgada por su propia elección. Él tiene un halo alrededor de su cabeza, que simboliza una nueva visión, conciencia e iluminación. Su pie derecho está atado al árbol, pero su pie izquierdo permanece libre, doblado por la rodilla y escondido detrás de su pierna derecha. Sus brazos están doblados, con las manos detrás de la espalda, formando un triángulo invertido. El hombre lleva pantalones rojos que representan la pasión humana y el cuerpo físico, y un chaleco azul para el conocimiento. El Colgado es la carta de la máxima rendición, de ser suspendido en el tiempo y del martirio y sacrificio por el bien común."),
    "card13" : MessageLookupByLibrary.simpleMessage("DERECHO: Finales, cambio, transformación, transición\n\nINVERTIDA: resistencia al cambio, transformación personal, purga interna\n\nLa carta de La Muerte muestra al Mensajero de la Muerte: un esqueleto vestido con una armadura negra que monta un caballo blanco. El esqueleto representa la parte del cuerpo que sobrevive mucho después de que la vida lo abandona; la armadura simboliza la invencibilidad y que la muerte vendrá pase lo que pase. Su color oscuro es el de luto y el misterioso, mientras que el caballo es el color de la pureza y actúa como un símbolo de fuerza y poder. La muerte lleva una bandera negra decorada con una rosa blanca de cinco pétalos, que refleja la belleza, la purificación y la inmortalidad y el número cinco que representa el cambio. Juntos, estos símbolos revelan que la muerte no se trata solo de terminar con la vida. La muerte se trata de finales y comienzos, nacimiento y renacimiento, cambio y transformación. Hay belleza en la muerte, y es una parte inherente de estar vivo.\n\nUna figura real parece estar muerta en el suelo, mientras que una mujer joven, un niño y un obispo suplican a la figura esquelética para evitarlos. Pero, como todos sabemos, la muerte no perdona a nadie.\n\nEn el fondo, un barco flota río abajo, similar a los barcos mitológicos que escoltan a los muertos al más allá. En el horizonte, el sol se pone entre dos torres (que también aparecen en la carta del Tarot de la Luna), muriendo cada noche y renaciendo todas las mañanas."),
    "card14" : MessageLookupByLibrary.simpleMessage("DERECHO: Equilibrio, moderación, paciencia, propósito\n\nINVERTIDA: Desequilibrio, exceso, autocuración, realineamiento\n\nLa carta de La Templanza muestra un ángel grande y alado que es masculino y femenino. Ella usa una túnica azul claro con un triángulo encerrado en un cuadrado en el frente, lo que representa que los humanos (el triángulo) están vinculados a la Tierra y a la ley natural (cuadrado). El ángel se balancea entre un pie en las rocas, expresando la necesidad de permanecer en tierra, y un pie en el agua, lo que demuestra la necesidad de estar en flujo. Ella vierte agua entre dos vasijas, simbolizando el flujo y la alquimia de la vida.\n\nEn el fondo, hay un camino sinuoso hasta una cordillera, que refleja el viaje a través de la vida. Sobre las montañas se cierne una corona dorada encerrada en una luz brillante, un símbolo de tomar el camino Superior y mantenerse fiel al propósito y significado de la vida."),
    "card15" : MessageLookupByLibrary.simpleMessage("DERECHO: Sombra, apego, adicción, restricción, sexualidad\n\nINVERTIDA: Liberar creencias limitantes, explorar pensamientos oscuros, desapego\n\nLa carta del Diablo muestra a Baphomet, o la Cabra Cornuda de Mendes, una criatura que es mitad hombre, mitad cabra. Baphomet originalmente representaba el equilibrio entre el bien y el mal, hombre y mujer, y humano y animal; Sin embargo, más recientemente, esta cifra se ha relacionado con lo oculto y se ha convertido en un chivo expiatorio de todas las cosas consideradas \"malvadas\".\n\nEl Diablo tiene las alas de un murciélago vampiro, un animal que absorbe la sangre de su presa, símbolo de lo que sucede cuando cedes a tus deseos crudos. Tiene una mirada hipnótica que \"magnetiza\" y atrae a los que se le acercan, poniéndolos bajo su poder. Sobre él hay un pentagrama invertido, un signo del lado oscuro de la magia y el ocultismo. Levanta su mano derecha en el Saludo Vulcano, una bendición judía, que más tarde se hizo famosa por la serie de películas Star Trek. En su mano izquierda, sostiene una antorcha encendida.\n\nAl pie del Diablo hay un hombre y una mujer, desnudos y encadenados al podio en el que se sienta el Diablo. Parecen estar retenidos aquí contra su voluntad, pero mira más de cerca, y notarás que las cadenas alrededor de sus cuellos están sueltas y podrían quitarse fácilmente. Cada uno tiene pequeños cuernos en la cabeza, como los del diablo, una señal de que se están volviendo cada vez más como él cuanto más tiempo permanecen aquí. Ambos tienen colas, un símbolo más de sus tendencias primitivas e instintos crudos, y las uvas y el fuego en sus colas respectivas significan placer y lujuria."),
    "card16" : MessageLookupByLibrary.simpleMessage("DERECHO: Cambio repentino, agitación, caos, revelación, despertar\n\nINVERTIDA: Transformación personal, miedo al cambio, evitar desastres\n\nLa Torre muestra una torre alta encaramada en la cima de una montaña rocosa. Los relámpagos prendieron fuego al edificio, y dos personas saltaron de las ventanas, con la cabeza primero y los brazos extendidos. Es una escena de caos y destrucción.\n\nLa Torre en sí es una estructura sólida, pero debido a que se ha construido sobre cimientos inestables, solo se necesita un rayo para derribarla. Representa ambiciones y objetivos hechos en premisas falsas.\n\nEl rayo representa una repentina oleada de energía y visión que conduce a un avance o revelación. Entra por la parte superior del edificio y desprende la corona, simbolizando la energía que fluye hacia abajo desde el Universo, a través del chakra de la corona. La gente está desesperada por escapar del edificio en llamas, sin saber lo que les espera mientras caen. Alrededor de ellos hay 22 llamas, que representan los 12 signos del zodíaco y 10 puntos del Árbol de la Vida, lo que sugiere que incluso en tiempos de desastre, siempre hay una intervención divina."),
    "card17" : MessageLookupByLibrary.simpleMessage("DERECHO: Esperanza, fe, propósito, renovación, espiritualidad\n\nINVERTIDA: Falta de fe, desesperación, autoconfianza, desconexión\n\nLa carta de La Estrella muestra a una mujer desnuda arrodillada al borde de una pequeña piscina. Ella sostiene dos recipientes de agua: uno en la mano izquierda (el subconsciente) y otro en la derecha (el consciente). Vierte el agua para nutrir la tierra y continuar el ciclo de fertilidad, representado por la exuberante vegetación a su alrededor. El otro recipiente vierte el agua en tierra firme en cinco riachuelos, que representan los cinco sentidos.\n\nLa mujer tiene un pie en el suelo, que representa sus habilidades prácticas y buen sentido común, y el otro pie en el agua, que representa su intuición, recursos internos y escuchar a su voz interior. Está desnuda, representando su vulnerabilidad y pureza bajo la inmensidad del cielo estrellado. Detrás de ella brilla una gran estrella, que representa sus esencias centrales, y siete estrellas más pequeñas, que representan los chakras."),
    "card18" : MessageLookupByLibrary.simpleMessage("DERECHO: Ilusión, miedo, ansiedad, subconsciente, intuición\n\nINVERTIDA: Liberación del miedo, emoción reprimida, confusión interna\n\nLa carta de La Luna muestra una luna llena en el cielo nocturno, colocada entre dos grandes torres. La luna es un símbolo de la intuición, los sueños y el inconsciente. Su luz es tenue en comparación con el sol, y solo ilumina levemente el camino hacia una mayor conciencia que serpentea entre las dos torres.\n\nEn primer plano hay una pequeña piscina que representa la mente acuosa y subconsciente. Un pequeño cangrejo de río se arrastra fuera de la piscina, simbolizando las primeras etapas del desarrollo de la conciencia. Un perro y un lobo se paran en el campo de hierba, aullando a la luna, representando los aspectos domesticados y salvajes de nuestras mentes."),
    "card19" : MessageLookupByLibrary.simpleMessage("DERECHO: Positividad, diversión, calidez, éxito, vitalidad\n\nINVERTIDA: Niño interno, deprimido, demasiado optimista\n\nLa carta El Sol irradia optimismo y positividad. Un gran sol brillante brilla en el cielo, representando la fuente de toda la vida en la Tierra. Debajo, cuatro girasoles crecen altos sobre una pared de ladrillos, representando los cuatro trajes de los Arcanos Menores y los cuatro elementos.\n\nEn primer plano, un niño joven y desnudo está sentado encima de un tranquilo caballo blanco. El niño representa la alegría de estar conectado con su espíritu interior, y su desnudez es una señal de que no tiene nada que ocultar y tiene toda la inocencia y la pureza de la infancia. El caballo blanco es también un signo de pureza y fuerza."),
    "card2" : MessageLookupByLibrary.simpleMessage("DERECHO: Intuición, conocimiento sagrado, divino femenino, la mente subconsciente\n\nINVERTIDA: Secretos, desconectada de la intuición, retirada y silencio\n\nLa Suma Sacerdotisa se sienta frente a un velo delgado decorado con granadas. El velo representa los reinos separados conscientes y subconscientes, lo visible y lo invisible, y sirve para mantener alejados a los espectadores casuales. Solo los iniciados pueden ingresar. Las granadas en el velo son un símbolo de abundancia, fertilidad y lo divino femenino, y son sagradas para Perséfone que comió una semilla de granada en el inframundo y se vio obligada a regresar cada año.\n\nA cada lado de la Suma Sacerdotisa hay dos pilares que marcan la entrada a este templo sagrado y místico (también asociado con el Templo de Salomón). Un pilar es negro con la letra B (Booz, que significa \"en su fuerza\") y el otro es blanco con la letra J (Jachin, que significa \"él establecerá\"). Los colores blanco y negro de los pilares simbolizan la dualidad, masculina y femenina, oscuridad y luz, indicando que se requiere conocimiento y aceptación de la dualidad para entrar en este espacio sagrado.\n\nLa Suma Sacerdotisa usa una túnica azul con una cruz en el pecho y una diadema con cuernos (o corona), tanto un símbolo de su conocimiento divino como su condición de gobernante divina. En su regazo, sostiene un pergamino con la letra TORA, que significa la Ley Mayor (según A. E. Waite). Está parcialmente cubierto, lo que significa que este conocimiento sagrado es tanto explícito como implícito, solo se revelará cuando el estudiante esté listo para mirar más allá del ámbito material. La luna creciente a sus pies simboliza su conexión con el divino femenino, su intuición y mente subconsciente y los ciclos naturales de la luna."),
    "card20" : MessageLookupByLibrary.simpleMessage("DERECHO: Juicio, renacimiento, llamado interno, absolución\n\nINVERTIDA: Dudas, crítico interno, ignorando la llamada\n\nLa carta El Juicio muestra hombres, mujeres y niños desnudos que se levantan de sus tumbas, con los brazos abiertos y mirando hacia el cielo. Arriba, el Arcángel Gabriel, el Mensajero de Dios, toca la trompeta. Las personas responden a su llamado, listas para ser juzgadas y descubrir si serán aceptadas en los cielos o no. En el fondo hay una extensa cadena montañosa, lo que significa los obstáculos insuperables y la imposibilidad de evitar el juicio."),
    "card21" : MessageLookupByLibrary.simpleMessage("DERECHO: Finalización, integración, realización, viaje\n\nINVERTIDA: Buscando cierre personal, atajos, demoras\n\nLa carta El Mundo muestra a una mujer desnuda envuelta en una tela morada, bailando dentro de una gran corona de laurel. Ella mira hacia atrás al pasado, mientras su cuerpo avanza hacia el futuro. En sus manos hay dos varitas o bastones, como el que sostiene El Mago. Es un símbolo de que lo que se manifestó con el Mago ahora se ha completado con el Mundo. La corona es circular, simbolizando un ciclo continuo de finalización exitosa y nuevos comienzos porque, a medida que la mujer avanza por la corona, está completando una fase pero iniciando otra casi de inmediato.\n\nAlrededor de la corona hay cuatro figuras (un león, un toro, un querubín y un águila), similares a las de la Rueda de la Fortuna. Tanto El Mundo como La Rueda de la Fortuna hablan de la naturaleza cíclica de su vida y su progresión a través de sus ciclos. Las cuatro figuras representan los cuatro signos fijos del zodíaco: Leo, Tauro, Acuario y Escorpio. Simbolizan los cuatro elementos, los cuatro palos del Tarot, los cuatro puntos cardinales, las cuatro estaciones y las cuatro esquinas del Universo. Están aquí para guiarle de una fase a la siguiente, brindando equilibrio y armonía a su viaje."),
    "card22" : MessageLookupByLibrary.simpleMessage("DERECHO: Inspiración, nuevas oportunidades, crecimiento, potencial\n\nINVERTIDA: Una idea emergente, falta de dirección, distracciones, retrasos\n\nEn el As de Bastos, una mano que sostiene una varita en crecimiento se extiende desde una nube, como para ofrecer una nueva oportunidad o idea con el potencial de crecer. El rico paisaje verde es una confirmación más de esta capacidad de crecimiento. En la distancia a la izquierda se encuentra un castillo, que representa la promesa de oportunidades para venir, y colinas y montañas bordean el horizonte. Sus picos rodantes nos recuerdan que siempre habrá desafíos en el camino, pero son superables con suficiente esfuerzo."),
    "card23" : MessageLookupByLibrary.simpleMessage("DERECHO: Planificación futura, progreso, decisiones, descubrimiento\n\nINVERTIDA: Objetivos personales, alineación interna, miedo a lo desconocido, falta de planificación\n\nEl Dos de Bastos muestra a un hombre, vestido con una túnica roja y un sombrero, sosteniendo un pequeño globo. El mundo está literalmente en sus manos, marcando el enorme potencial ante él si puede expandir sus horizontes en consecuencia. Se para dentro de los límites de su castillo, sugiriendo que mientras contempla oportunidades significativas, el hombre aún no ha abandonado su zona de confort para perseguirlas; él todavía está muy en la fase de planificación. Su mano descansa sobre una varita vertical, y una segunda varita está pegada a la pared del castillo, una señal más de que todavía no está listo para aventurarse. En el fondo, la tierra es fértil y también rocosa, prometiendo que tiene una buena oportunidad de éxito, siempre que pueda superar los desafíos que surgirán."),
    "card24" : MessageLookupByLibrary.simpleMessage("DERECHO: Progreso, expansión, previsión, oportunidades en el extranjero\n\nINVERTIDA: Jugar pequeño, falta de previsión, retrasos inesperados\n\nEl Tres de Bastos representa a un hombre con túnicas rojas y verdes de pie en un acantilado con la espalda vuelta. Tres varitas están firmemente plantadas en el suelo, lo que refleja su compromiso con sus planes. Ha dejado la comodidad del castillo en el Dos de Bastos y ahora está en un vasto espacio abierto, mirando hacia el mar a montañas distantes. Observa pasar tres veleros, simbólicos de movimiento y progresión. Desde su alto punto de vista, puede ver todo lo que le espera, incluidos los desafíos y oportunidades que se avecinan."),
    "card25" : MessageLookupByLibrary.simpleMessage("DERECHO: Celebración, alegría, armonía, relajación, regreso a casa\n\nINVERTIDA: Celebración personal, armonía interior, conflicto con otros, transición.\n\nEl Cuatro de Bastos muestra a dos personas felices bailando y celebrando con flores en sus manos. En primer plano, una hermosa corona llena de flores y uvas se suspende entre las varitas. Juntos, estos elementos representan la alegría y la satisfacción que conlleva alcanzar un objetivo o hito importante. En el fondo, otro grupo de personas (quizás una familia) se para frente a un gran castillo, representando la seguridad y la comodidad del hogar."),
    "card26" : MessageLookupByLibrary.simpleMessage("DERECHO: Conflicto, desacuerdos, competencia, tensión, diversidad\n\nINVERTIDA: Conflicto interno, evitación de conflictos, liberación de tensión\n\nEn el Cinco de Bastos, cinco hombres parecen estar luchando entre sí, usando sus varitas como armas. Sin embargo, en una observación más cercana, sus varitas están levantadas pero no golpean ni hieren a nadie. Es como si no hubiera un propósito o resultado real en esta escena caótica que no sea crear conflicto y sembrar discordia entre el grupo. Cada hombre usa un atuendo diferente, que simboliza sus diversos orígenes y sistemas de creencias, y sugiere que, debido a sus diferencias, no pueden encontrar armonía y puntos en común entre sí."),
    "card27" : MessageLookupByLibrary.simpleMessage("DERECHO: Éxito, reconocimiento público, progreso, autoconfianza\n\nINVERTIDA: Logro privado, definición personal de éxito, caída en desgracia, egoísmo\n\nEl Seis de Bastos representa a un hombre con una corona de victoria alrededor de su cabeza y montando un caballo blanco decorado a través de una multitud de personas que lo vitoreaban. Su caballo representa la fuerza, la pureza y la progresión exitosa de una aventura, y el grupo de personas marca el reconocimiento público de los logros del hombre. El jinete sostiene una varita vertical con una corona atada a la parte superior, enfatizando aún más el éxito y el logro. No tiene miedo de mostrar a los demás lo que ha logrado en su vida hasta ahora y, aún mejor, la multitud que lo rodea está encantada de animarlo."),
    "card28" : MessageLookupByLibrary.simpleMessage("DERECHO: Desafío, competencia, protección, perseverancia\n\nINVERTIDA: Agotamiento, rendición, abrumado\n\nEl Siete de Bastos representa a un hombre en la cima de una colina, armado con una varita en cada mano y luchando contra seis varitas más que se dibujan desde abajo. Parece estar defendiendo su territorio y sus éxitos. Curiosamente, el hombre lleva dos zapatos diferentes, lo que sugiere que puede haber sido sorprendido o no preparado para la batalla, o puede que no esté claro de su propia postura y opinión."),
    "card29" : MessageLookupByLibrary.simpleMessage("DERECHO: Movimiento, cambio de ritmo rápido, acción, alineación, viaje aéreo\n\nINVERTIDA: Retrasos, frustración, resistencia al cambio, alineación interna\n\nEl Ocho de Bastos muestra ocho varitas que surgen en el aire a gran velocidad. Su vuelo sugiere cambio, movimiento y viaje. El cielo está despejado y el hermoso río fluye libremente y da vida al paisaje circundante."),
    "card3" : MessageLookupByLibrary.simpleMessage("DERECHO: Feminidad, belleza, naturaleza, crianza, abundancia\n\nINVERTIDA: Bloqueo creativo, dependencia de otros\n\nLa Emperatriz es una mujer hermosa, de figura completa, con cabello rubio y un aura pacífica sobre ella. En su cabeza, ella usa una corona de doce estrellas, mostrando su conexión con el reino místico y los ciclos del mundo natural (los doce meses del año y los doce planetas). Su túnica está estampada con granadas, símbolo de fertilidad, y se asienta sobre una lujosa gama de cojines y terciopelo rojo. Un cojín presenta el símbolo de Venus, el planeta del amor, la creatividad, la fertilidad, la belleza y la gracia, la esencia de La Emperatriz.\n\nUn hermoso y exuberante bosque y una sinuosa corriente rodean a La Emperatriz, lo que significa su conexión con la Madre Tierra y la vida misma. Ella extrae su sensación de paz de los árboles y el agua y se rejuvenece con la energía de la naturaleza. En primer plano, el trigo dorado brota del suelo, reflejando la abundancia de una cosecha reciente."),
    "card30" : MessageLookupByLibrary.simpleMessage("DERECHO: Resiliencia, coraje, persistencia, prueba de fe, límites\n\nINVERTIDA: Recursos internos, lucha, agobio, defensa, paranoia\n\nEl Nueve de Bastos muestra a un hombre herido, agarrando una varita. Él mira por encima del hombro hacia las ocho varitas que se ciernen sobre él. Parece cansado y desgastado, como si ya hubiera pasado por una batalla y ahora debe enfrentar desafíos adicionales con la presencia de estas ocho varitas. Sin embargo, como un Nueve, este es su desafío final antes de alcanzar su objetivo; debe soportar esta última prueba de su fuerza y carácter antes de llegar a la meta."),
    "card31" : MessageLookupByLibrary.simpleMessage("DERECHO: Carga, responsabilidad extra, trabajo duro, finalización\n\nINVERTIDA: Hacerlo todo, llevar la carga, delegar, liberar\n\nEl Diez de Bastos muestra a un hombre llevando un gran paquete de palos hacia una pequeña ciudad a poca distancia. Su espalda está doblada y parece estar agobiado por la carga pesada que lleva, pero sabe que está casi en su destino y pronto podrá liberar el peso pesado que está cargando."),
    "card32" : MessageLookupByLibrary.simpleMessage("DERECHO: Inspiración, ideas, descubrimiento, potencial ilimitado, espíritu libre\n\nINVERTIDA: Ideas recién formadas, energía de redireccionamiento, creencias autolimitantes, un camino espiritual\n\nEl Paje de Bastos muestra a un joven que sostiene un bastón largo con ambas manos mientras mira con curiosidad las hojas verdes que brotan de la parte superior. Su túnica está adornada con salamandras, una criatura mítica asociada con el fuego y la transformación. El Paje se detiene, con su bastón firmemente plantado en el suelo, lo que sugiere que si bien está inspirado por el crecimiento potencial representado por el bastón en brote, todavía no ha tomado medidas sobre esta inspiración.\n\nEn el fondo, el paisaje es árido y montañoso, lo que implica que este Paje tiene el don de poder encontrar crecimiento y potencial en los lugares más improbables. Sus ideas lo estimulan tanto que puede hacer que suceda cualquier cosa y no está limitado por sus circunstancias."),
    "card33" : MessageLookupByLibrary.simpleMessage("DERECHO: Energía, pasión, acción inspirada, aventura, impulsividad\n\nINVERTIDA: Proyecto de pasión, prisa, energía dispersa, retrasos, frustración\n\nEl Caballero de Bastos se sienta en su caballo con una armadura completa, con una túnica amarilla decorada con salamandras (asociadas con el elemento de fuego) y un casco con ardientes plumas rojas que fluyen detrás de él. Él sostiene una varita en crecimiento en su mano derecha, que simboliza su energía y entusiasmo por su misión. Su caballo se levanta sobre sus patas traseras, listo para la acción. Al igual que todas las cartas de corte de Bastos, el fondo es cálido, seco y árido, con montañas que se elevan a lo lejos."),
    "card34" : MessageLookupByLibrary.simpleMessage("DERECHO: Valor, confianza, independencia, mariposa social, determinación\n\nINVERTIDA: Autoestima, confianza en sí mismo, introvertido, restablecer el sentido de sí mismo\n\nLa Reina de Bastos se sienta sobre un trono decorado con leones que se enfrentan a direcciones opuestas, un símbolo de fuego y fuerza. En su mano izquierda, en su corona y detrás de ella hay girasoles, que simbolizan la vida, la fertilidad, la alegría y la satisfacción, y su mano derecha sostiene una varita con un pequeño brote. Un gato negro se sienta a sus pies, una señal de que, si bien esta Reina es audaz y extrovertida, también está en contacto con su yo en la sombra, el lado más oscuro y menos conocido de su ser."),
    "card35" : MessageLookupByLibrary.simpleMessage("DERECHO: Líder nato, visión, emprendedor, honor\n\nINVERTIDA: impulsividad, prisa, despiadado, altas expectativas\n\nEl Rey de Bastos se sienta en su trono, sosteniendo una varita floreciente en su mano, un símbolo de vida y creatividad. Su trono y capa están decorados con leones y salamandras, ambos símbolos de fuego y fuerza. Las salamandras que muerden sus propias colas representan el infinito y el impulso continuo para avanzar contra todos los obstáculos."),
    "card36" : MessageLookupByLibrary.simpleMessage("DERECHO: Una nueva oportunidad financiera o profesional, manifestación, abundancia\n\nINVERTIDA: Oportunidad perdida, falta de planificación y previsión\n\nEl As de Oros representa una mano que emerge de las nubes, al igual que los Ases de los otros cortes. Una moneda grande se encuentra en la palma ahuecada, disponible gratuitamente para quien tenga los medios para tomarla. Es como si una nueva oportunidad, asociada con la riqueza, los negocios y la manifestación, hubiera aparecido de la nada y ahora se te esté extendiendo en todo su esplendor. El ímpetu está en ti para que aceptes esta oferta y la conviertas en algo significativo y sostenible.\n\nEl paisaje en esta carta es exuberante y abundante: un jardín lleno de hierba verde y lirios blancos. Un pequeño sendero conduce a un arco, envuelto en un hermoso follaje y flores y, más allá del arco, los picos de las montañas se elevan en el horizonte. Estas imágenes verdes indican que ha llegado el momento de avanzar con su carrera y ambiciones financieras. Si bien requerirá trabajo duro y determinación (escalar montañas no es una tarea fácil), el As de Oros lo alienta a aprovechar al máximo esta oportunidad mientras está en su estado más abundante."),
    "card37" : MessageLookupByLibrary.simpleMessage("DERECHO: Múltiples prioridades, gestión del tiempo, priorización, adaptabilidad\n\nINVERTIDA: Sobre-comprometido, desorganización, re-priorización.\n\nEn el Dos de Oros, un joven baila mientras hace malabares con dos monedas en sus manos. El símbolo de infinito une las monedas, lo que sugiere que este hombre puede manejar problemas ilimitados siempre que administre bien su tiempo, energía y recursos. En el fondo, dos barcos navegan en alta mar, subiendo y bajando sobre las enormes olas, otra señal de que los altibajos de la vida son manejables con enfoque y atención."),
    "card38" : MessageLookupByLibrary.simpleMessage("DERECHO: Trabajo en equipo, colaboración, aprendizaje, implementación.\n\nINVERTIDA: Desarmonía, desalineación, trabajar solo\n\nEl Tres de Oros muestra a un joven albañil trabajando con sus herramientas en una parte de una catedral. Frente a él, dos arquitectos sostienen los planos del diseño. Los altos techos y los intrincados grabados significan que ambas partes son hábiles en sus respectivos oficios. El albañil parece estar discutiendo su progreso hasta ahora con los arquitectos, y aunque tiene menos experiencia, valoran su opinión y su conocimiento especializado. Su lenguaje corporal insinúa que este joven es un contribuyente esencial para la finalización de la catedral y los arquitectos quieren asegurarse de que todos estén en la misma página."),
    "card39" : MessageLookupByLibrary.simpleMessage("DERECHO: Ahorro de dinero, seguridad, conservadurismo, escasez, control\n\nINVERTIDA: Gasto excesivo, avaricia, autoprotección\n\nEl Cuatro de Oros muestra a un hombre sentado en un taburete, más allá de los límites de su ciudad natal. Sus brazos están fuertemente apretados alrededor de una moneda, como si temiera perderla si afloja su agarre. Equilibra otro oro sobre su cabeza, impidiendo su conexión con el espíritu, y dos oros más están asegurados bajo sus pies. Claramente no quiere que nadie tome sus monedas. Sin embargo, debido a que está tan apegado a su dinero, no puede moverse ni ir a ningún lado. No tiene a nadie con quien hablar, ni siquiera los amigos y familiares de la comunidad detrás de él. El hombre se encuentra atrapado en un lugar con una fijación singular: la riqueza."),
    "card4" : MessageLookupByLibrary.simpleMessage("DERECHO: Autoridad, establecimiento, estructura, figura paterna\n\nINVERTIDA: Dominación, control excesivo, falta de disciplina, inflexibilidad\n\nSi La Emperatriz es el arquetipo Madre de la baraja del Tarot, El Emperador es el Padre. Se sienta sobre un gran trono de piedra, adornado con cuatro cabezas de carneros (símbolo de su conexión con Aries y el planeta Marte). En su mano derecha, el Emperador sostiene un ankh, el símbolo egipcio de la vida, y en su izquierda hay un orbe que representa el mundo sobre el que gobierna.\n\nLleva una túnica roja, indicativa de su poder, pasión y energía para la vida. Debajo de él, usa una armadura, lo que sugiere que está protegido de cualquier amenaza (y cualquier respuesta emocional o vulnerabilidad). Su larga barba blanca simboliza su antigua sabiduría y experiencia, y junto con su corona de oro, es una figura de autoridad que exige ser escuchado.\n\nDetrás de su trono se alza una cordillera alta e impenetrable, lo que significa que está respaldado por una base sólida pero resistente a hacer cambios a menos que lo considere necesario. Debajo de los picos fluye un pequeño río, dando la esperanza de que, a pesar de su exterior duro, él sigue siendo un ser emocional: solo requerirá mucha excavación y confianza para abrirlo a su lado más suave."),
    "card40" : MessageLookupByLibrary.simpleMessage("DERECHO: Pérdida financiera, pobreza, falta de mentalidad, aislamiento, preocupación\n\nINVERTIDA: Recuperación de la pérdida financiera, pobreza espiritual\n\nEn el Cinco de Oros, dos personas caminan a través del viento helado y la nieve; ambos son indigentes y viven en la pobreza. Un hombre está herido y con muletas, mientras que el otro está descalzo y solo tiene una manta delgada para protegerlo del sombrío clima invernal. Detrás de ellos se encuentra una iglesia con su calidez iluminada y exudante, un símbolo de esperanza, fe y apoyo espiritual. Sin embargo, debido a que las dos personas están tan concentradas en su difícil situación, no pueden ver que la ayuda está disponible para ellos y continúan en su viaje desesperado."),
    "card41" : MessageLookupByLibrary.simpleMessage("DERECHO: Dar, recibir, compartir riqueza, generosidad, caridad\n\nINVERTIDA: Autocuidado, deudas impagas, caridad unilateral\n\nEl Seis de Oros muestra a un hombre rico vestido con una túnica roja, entregando monedas a dos mendigos que se arrodillan a sus pies. En su mano izquierda, tiene una balanza, que representa la equidad y la igualdad. Esta carta refleja un estado de seguridad financiera y generosidad, lo que sugiere que puede utilizar generosamente su riqueza y abundancia en beneficio de los demás. Pero también habla de recibir generosidad y la sensación de alivio que acompaña a la asistencia que tanto se necesita. El Seis de Oros es una carta de dar y recibir. A veces, te toca dar; otras veces, recibir. Es un ciclo continuo de vida, y esta carta sirve como recordatorio de que tus recursos pueden cambiar en cualquier momento. Incluso si está rodeado de riqueza, habrá momentos en los que necesite la ayuda y el apoyo de otros, por lo tanto, sea generoso con sus recursos, ya que puede necesitar apoyo en el futuro."),
    "card42" : MessageLookupByLibrary.simpleMessage("DERECHO: Visión a largo plazo, resultados sostenibles, perseverancia, inversión\n\nINVERTIDA: Falta de visión a largo plazo, éxito limitado o recompensa\n\nEn el Siete de Oros, un hombre se apoya en su azada, contemplando su abundante cosecha. Ha trabajado mucho para cultivar pequeñas semillas en este próspero jardín y ahora puede tomar un descanso para disfrutar de los frutos de su trabajo. Sin embargo, tenga en cuenta la expresión en su rostro: también se ve cansado, incluso un poco \"agobiado\", de haber trabajado tan duro para esta cosecha exitosa. El éxito proviene del trabajo duro y la paciencia, pero esta carta te recuerda que debes tener cuidado de no excederte y agotarte."),
    "card43" : MessageLookupByLibrary.simpleMessage("DERECHO: Aprendizaje, tareas repetitivas, dominio, desarrollo de habilidades\n\nINVERTIDA: Autodesarrollo, perfeccionismo, actividad mal dirigida\n\nEl Ocho de Oros muestra a un joven grabando cuidadosamente un pentáculo en cada moneda. En el fondo, hay un pequeño pueblo, sin embargo, se ha separado de las distracciones de la vida hogareña para poder dedicarse por completo a la tarea en cuestión. Se está concentrando mucho, ansioso por hacer un buen trabajo y evitar cualquier error. A medida que crea cada moneda, sus habilidades mejoran y se convierte en un maestro en su oficio."),
    "card44" : MessageLookupByLibrary.simpleMessage("DERECHO: Abundancia, lujo, autosuficiencia, independencia financiera\n\nINVERTIDA: Autoestima, sobreinversión en trabajo, ajetreo\n\nEl Nueve de Oros muestra a una mujer bien vestida de pie en un hermoso jardín. Lleva una túnica dorada y una boina roja, signos de su riqueza y estatus social. Las vides detrás de ella están llenas de uvas y monedas de oro, que representan el fructífero logro de todos sus deseos. Su mano derecha descansa sobre una de las muchas monedas, y sus dedos se envuelven alrededor de las uvas moradas en la vid, simbolizando su relación saludable con el dinero. Ella puede disfrutar de los frutos de su trabajo sin exagerar. Un halcón encapuchado se sienta con calma en su mano izquierda, lo que significa el autocontrol intelectual y espiritual de la mujer. En el fondo hay una casa grande, presumiblemente perteneciente a la mujer misma, una señal más de su abundancia de riqueza y abundancia financiera."),
    "card45" : MessageLookupByLibrary.simpleMessage("DERECHO: Riqueza, seguridad financiera, familia, éxito a largo plazo, contribución\n\nINVERTIDA: El lado oscuro de la riqueza, el fracaso financiero o la pérdida.\n\nEl Diez de Oros muestra a un anciano de pelo blanco con una bata bordada adornada, sentado con sus dos fieles perros blancos a sus pies. Una pareja más joven se encuentra cerca con un niño pequeño. El hombre es un patriarca rico que ha logrado mucho durante su vida y está inmensamente satisfecho de que ahora puede compartir su riqueza y abundancia con sus seres queridos. Sus éxitos y logros ahora brindan seguridad financiera y seguridad a su familia. Él ya puede ver el legado que ha creado.\n\nEl hombre y su familia se reúnen en el patio de un gran castillo, marcando su prosperidad, comodidad y seguridad financiera. En el arco hay emblemas y banderas familiares, un símbolo de su historia y ascendencia. Su riqueza va mucho más allá del confort material; El hombre y su familia tienen una conexión muy arraigada con su linaje, hogar y comunidad."),
    "card46" : MessageLookupByLibrary.simpleMessage("DERECHO: Manifestación, oportunidad financiera, desarrollo de habilidades\n\nINVERTIDA: Falta de progreso, dilación, aprender del fracaso\n\nEl Paje de Oros representa a un joven parado en un campo de flores. En la distancia detrás de él hay un pequeño parche de árboles y un campo recién arado, que promete una cosecha abundante. La cordillera en el horizonte significa los próximos desafíos y obstáculos que el Paje debe superar a lo largo de su viaje. El Paje sostiene una moneda de oro en su mano y la examina cuidadosamente, como para descubrir cómo manifestar aún más oro y abundancia."),
    "card47" : MessageLookupByLibrary.simpleMessage("DERECHO: Trabajo duro, productividad, rutina, conservadurismo\n\nINVERTIDA: Autodisciplina, aburrimiento, sentirse \"atrapado\", perfeccionismo\n\nEl Caballero de Oros se sienta en un caballo de tiro estacionario, mirando cuidadosamente la moneda de oro que tiene en la mano. No tiene prisa, prefiere evaluar y planificar su camino antes de tomar medidas. En el fondo, hay un amplio campo que ha sido laboriosamente arado fila por fila, simbolizando que este Caballero está listo y dispuesto a hacer el trabajo para realizar sus sueños, incluso si es repetitivo y aburrido."),
    "card48" : MessageLookupByLibrary.simpleMessage("DERECHO: Nutritivo, práctico, proporcionando financieramente, un padre trabajador\n\nINVERTIDA: Independencia financiera, autocuidado, conflicto trabajo-hogar\n\nEn la Reina de Oros, una mujer se sienta en un trono de piedra decorado con tallas de árboles frutales, cabras, ángeles y otros símbolos de éxito material y placer sensual. Acuna una moneda de oro con ambas manos y la mira con amoroso cuidado, como para nutrir este símbolo de riqueza y éxito material. Plantas y flores deliciosas la rodean, representando su conexión con la Madre Tierra, la naturaleza y la abundancia. Un pequeño conejo salta cerca de donde está sentada, simbolizando la fertilidad y sugiriendo que su vida está fluyendo y alineándose."),
    "card49" : MessageLookupByLibrary.simpleMessage("DERECHO: Riqueza, negocios, liderazgo, seguridad, disciplina, abundancia\n\nINVERTIDA: Financieramente inepto, obsesionado con la riqueza y el estado, terco\n\nEl Rey de Oros se sienta en un trono adornado con tallas de toros, lo que representa su conexión con el signo astrológico de Tauro, y las uvas y las vides adornan su túnica, simbolizando la riqueza y la abundancia. En su mano derecha, sostiene el cetro de su poder, y en su izquierda, sostiene una moneda de oro, simbólica de su influencia material. Este Rey tiene una habilidad innata para crear riqueza material y abundancia financiera, y mejor aún, puede mantener su riqueza a lo largo del tiempo a través de la autodisciplina, el control y el liderazgo.\n\nA sus pies y alrededor de su trono hay más enredaderas, flores y plantas, que representan el mayor logro del éxito material. Su castillo se encuentra detrás de él, un símbolo de todo lo que ha construido a través de sus esfuerzos y determinación. Por lo tanto, este Rey se toma muy en serio la seguridad financiera y ha hecho de la acumulación de riqueza su foco en la vida. Está orgulloso de sus logros y le gusta mostrar a los demás sus preciadas posesiones y riqueza."),
    "card5" : MessageLookupByLibrary.simpleMessage("DERECHO: Sabiduría espiritual, creencias religiosas, conformidad, tradición, instituciones\n\nINVERTIDA: Creencias personales, libertad, desafiando el status quo\n\nEl Hierofante es la contraparte masculina de La Suma Sacerdotisa. También es conocido como el Papa o el Maestro en otras barajas de Tarot y es gobernado por Tauro.\n\nEl Hierofante es una figura religiosa sentada entre dos pilares de un templo sagrado, aunque este templo difiere de aquel en el que se sienta La Suma Sacerdotisa. Lleva tres túnicas: rojo, azul y blanco, y una corona de tres niveles, ambos representan los tres mundos sobre los que gobierna (el consciente, el subconsciente y el superconsciente). En su mano izquierda, sostiene la Cruz Papal, un triple cetro que significa su estatus religioso. Levanta su mano derecha en una bendición religiosa, con dos dedos apuntando hacia el cielo y dos hacia la tierra.\n\nAnte él se arrodillan dos seguidores. La tarea del Hierofante es transmitir su sabiduría espiritual e iniciar a los dos en la iglesia para que puedan asumir sus roles designados. Estas imágenes hablan de una identidad grupal compartida y un rito de iniciación para ingresar al siguiente nivel. Las llaves cruzadas a los pies del Hierofante representan el equilibrio entre las mentes conscientes y subconscientes y el desbloqueo de misterios, que solo él puede enseñar."),
    "card50" : MessageLookupByLibrary.simpleMessage("DERECHO: Amor, nuevas relaciones, compasión, creatividad\n\nINVERTIDA: Amor propio, intuición, emociones reprimidas\n\nEl As de Copas muestra un cáliz rebosante de cinco corrientes de agua. La copa representa el vaso de tu mente subconsciente; Las cinco corrientes son tus cinco sentidos y la abundante emoción e intuición que fluye desde tu interior. La mano que sostiene la copa se desliza fuera de las nubes, un símbolo de la conciencia de tu energía espiritual y su influencia. Debajo de la mano hay un vasto mar cubierto de flores de loto, que significa el despertar del espíritu humano. Una paloma desciende hacia la copa, un símbolo del amor divino que fluye a través de la mente subconsciente hacia la conciencia."),
    "card51" : MessageLookupByLibrary.simpleMessage("DERECHO: Amor unificado, sociedad, atracción mutua\n\nINVERTIDA: Amor propio, rupturas, falta de armonía, desconfianza\n\nEl Dos de Copas muestra a un hombre y una mujer jóvenes, intercambiando copas y prometiendo su amor mutuo. Sobre ellos flota el Caduceo de Hermes, un bastón alado con dos serpientes envueltas alrededor, el antiguo símbolo del comercio, el comercio y el intercambio. En la parte superior del caduceo hay una cabeza de león, lo que significa pasión y energía de fuego y sugiere que puede haber mucha energía sexual ardiente entre estas dos personas."),
    "card52" : MessageLookupByLibrary.simpleMessage("DERECHO: Celebración, amistad, creatividad, colaboraciones\n\nINVERTIDA: Independencia, tiempo a solas, fiesta hardcore, \"tres son multitud\"\n\nEn el Tres de Copas, tres mujeres jóvenes bailan juntas en círculo, levantando sus copas en el aire en un brindis de alegría y celebración. Se miran con aprecio, honor y respeto, y están unidos por su conexión emocional y amistad. Existe la sensación de elevarse mutuamente y celebrar la contribución única de cada mujer al grupo. El suelo está cubierto de flores, frutas y una calabaza, que simboliza la celebración de una cosecha abundante y la bondad de la vida."),
    "card53" : MessageLookupByLibrary.simpleMessage("DERECHO: Meditación, contemplación, apatía, reevaluación\n\nINVERTIDA: Retirada, retirada, verificación de alineación\n\nEl Cuatro de Copas muestra a un joven sentado bajo un árbol con los brazos cruzados, sumido en la contemplación y la meditación. Está tan absorto en sus pensamientos que no parece darse cuenta del brazo extendido que le ofrece una copa. Otras tres copas están a sus pies, pero de nuevo, tampoco parece darse cuenta o preocuparse por estas nuevas oportunidades."),
    "card54" : MessageLookupByLibrary.simpleMessage("DERECHO: Arrepentimiento, fracaso, desilusión, pesimismo\n\nINVERTIDA: Reveses personales, perdón de uno mismo, seguir adelante\n\nEl Cinco de Copas muestra a un hombre con una larga capa negra mirando tres copas que se han volcado, lo que simboliza sus decepciones y fracasos. Detrás de él hay dos copas que representan nuevas oportunidades y potencial, pero debido a que está tan concentrado en sus pérdidas (las copas volteadas), pierde las oportunidades disponibles para él.\n\nAl fondo, un puente cruza un gran río que fluye y conduce a la seguridad del castillo o la casa en el lado opuesto de la orilla del río, si solo superase el hecho de las copas volteadas. El puente es un mensaje para \"construir un puente y superarlo\"."),
    "card55" : MessageLookupByLibrary.simpleMessage("DERECHO: Revisitando el pasado, recuerdos de la infancia, inocencia, alegría\n\nINVERTIDA: Vivir en el pasado, perdón, falta de alegría\n\nEn el Seis de Copas, un niño se inclina y le pasa una copa llena de flores a una niña más joven. La niña mira al niño con amor y respeto mientras él le ofrece las flores. El amor, la armonía y la cooperación, todos los elementos clave del Seis de Copas, brillan a través de este acto gentil. Los niños pequeños también representan recuerdos de la infancia.\n\nEn el fondo, un hombre mayor se aleja en la distancia, como si dijera que ya no necesita preocuparse por los problemas de los adultos; solo disfruta el momento de ser joven, inocente y libre nuevamente. Los niños también parecen estar parados en el patio de una casa grande, simbolizando comodidad, seguridad y protección. En primer plano hay cuatro copas más llenas de flores, y una quinta copa se sienta en un pedestal detrás del niño. C"),
    "card56" : MessageLookupByLibrary.simpleMessage("DERECHO: Oportunidades, elecciones, ilusiones, ilusión\n\nINVERTIDA: Alineamiento, valores personales, abrumado por las elecciones\n\nEn el Siete de Copas, un hombre se para ante siete copas llenas de varios regalos. Algunas copas llevan regalos deseables, como joyas y una corona de victoria. Pero otros tienen regalos que no son regalos en absoluto; en cambio, son maldiciones, como la serpiente o el dragón. Las nubes y las copas simbolizan los deseos y sueños del hombre, y los diferentes regalos en su interior sugieren que debes tener cuidado con lo que deseas, ya que no todo es lo que parece. Deben hacerse elecciones, pero al hacerlo, debe ir más allá de la ilusión y el atractivo, y en su lugar centrarse en lo que es adecuado para usted."),
    "card57" : MessageLookupByLibrary.simpleMessage("DERECHO: Decepción, abandono, retirada, escapismo\n\nINVERTIDA: Intentando una vez más, indecisión, deriva sin rumbo, alejándose\n\nEn el Ocho de Copas, un hombre se aleja de las ocho copas que están en primer plano. Las copas están dispuestas de tal manera que parece que falta una, una señal de que falta la realización emocional y la integridad. El hombre le ha dado la espalda a estas copas con una sensación de pérdida y decepción y se aleja arrastrando los pies hacia las montañas. Un río cercano simboliza sus emociones, y las montañas representan la conciencia de que este no será un viaje fácil (aunque será necesario para la verdadera felicidad a largo plazo). La luna en el cielo nocturno ilumina el camino por delante: el hombre se marcha en la oscuridad de la noche con la esperanza de pasar desapercibido, lo que sugiere que puede haber un nivel de escape o evasión en esta carta."),
    "card58" : MessageLookupByLibrary.simpleMessage("DERECHO: Satisfacción, satisfacción, gratitud, deseo hecho realidad\n\nINVERTIDA: Felicidad interior, materialismo, insatisfacción, indulgencia\n\nEn el Nueve de Copas, un hombre se sienta en un banco de madera. Está cómodo, pero no demasiado cómodo (¡no querrás sentarte en ese banco de madera todo el día!). Sus brazos están cruzados, y tiene una sonrisa en su rostro, expresando satisfacción y contento. Detrás de él hay una estructura curva envuelta en material azul, con nueve copas doradas dispuestas en un arco. Las copas representan la satisfacción emocional después de llevar a cabo tus deseos más profundos."),
    "card59" : MessageLookupByLibrary.simpleMessage("DERECHO: Amor divino, relaciones felices, armonía, alineación\n\nINVERTIDA: Desconexión, valores desalineados, relaciones difíciles\n\nEn el Diez de Copas, una pareja amorosa está de pie, con los brazos extendidos, mientras sus dos hijos juegan cerca. Miran hacia su casa en la colina y un hermoso arcoiris en el cielo que contiene diez copas. Estos dos tienen un amor verdadero y eterno y tienen todo lo que podrían desear: el hogar, los niños y, lo que es más importante, un amor pleno, y comparten este vínculo con las personas que los rodean.\n\nLa casa familiar simboliza estabilidad y comodidad, mientras que las colinas cubiertas de hierba significan fertilidad y el río marca el flujo de la emoción. El arcoíris señala el final de los tiempos difíciles y es una señal de lo Divino de que todo estará bien. La escena idílica es una de verdadera realización emocional y amor divino."),
    "card6" : MessageLookupByLibrary.simpleMessage("DERECHO: Amor, armonía, relaciones, alineación de valores, elecciones\n\nINVERTIDA: Amor propio, falta de armonía, desequilibrio, desalineación de valores\n\nLa carta de Los Enamorados muestra a un hombre y una mujer desnudos de pie debajo del ángel, Rafael, cuyo nombre significa \"Dios sana\" y representa la curación física y emocional. El ángel bendice al hombre y a la mujer y les recuerda su unión con lo Divino.\n\nLa pareja se encuentra en un hermoso y fértil paisaje, que recuerda al Jardín del Edén. Detrás de la mujer se encuentra un alto manzano, con una serpiente que sube por el tronco. La serpiente y el manzano representan la tentación de los placeres sensuales que pueden desviar la atención de lo Divino. Detrás del hombre hay un árbol de llamas, que representan la pasión, la principal preocupación del hombre. Las doce llamas sugieren los doce signos del zodiaco, el símbolo del tiempo y la eternidad. El hombre mira a la mujer, que observa al ángel, mostrando el camino de lo consciente a lo subconsciente a lo súper consciente, o del deseo físico a las necesidades emocionales a las preocupaciones espirituales.\n\nLa montaña volcánica en el fondo es bastante fálica y representa la erupción de la pasión que ocurre cuando el hombre y la mujer se encuentran en plena desnudez frontal."),
    "card60" : MessageLookupByLibrary.simpleMessage("DERECHO: Oportunidades creativas, mensajes intuitivos, curiosidad, posibilidad\n\nINVERTIDA: Nuevas ideas, intuición dudosa, bloqueos creativos, inmadurez emocional\n\nEl Paje de Copas lleva una túnica azul con estampado floral y una boina en la cabeza con una bufanda larga y fluida. Se para en la orilla, con el mar ondulado detrás de él, sosteniendo una copa en su mano derecha. Sorprendentemente, un pez saca la cabeza de la copa y mira al joven. El pez y el mar detrás de él representan el elemento del agua y todo lo que tiene que ver con la creatividad, la intuición, los sentimientos y las emociones. La aparición inesperada del pez significa que la inspiración creativa a menudo sale de la nada y solo cuando estás abierto a ella."),
    "card61" : MessageLookupByLibrary.simpleMessage("DERECHO: Creatividad, romance, encanto, imaginación, belleza\n\nINVERTIDA: Imaginación hiperactiva, poco realista, celosa, de mal humor\n\nEn el Caballero de Copas, un caballero monta un caballo blanco y extiende una copa de oro como si llevara un mensaje del corazón. Sobre su armadura, el caballero lleva una capa cubierta con imágenes de peces, el símbolo del agua, la conciencia y la creatividad. Su casco y botas son alados, un símbolo de una imaginación activa y creativa y un aprecio por las cosas bellas.\n\nA diferencia del Caballero de Bastos o el Caballero de Espadas, el caballo en el Caballero de Copas no avanza, sino que se mueve lentamente y con gracia, dando un aire de calma y paz. El caballo representa poder, energía y empuje, y el color blanco es un símbolo de pureza, espiritualidad y luz.\n\nEl fondo es mayormente árido, a excepción de algunos árboles lejanos y el río que lo atraviesa, simbolizando el poder de las emociones y la imaginación para crear una nueva fuerza de vida, incluso cuando parezca que no hay ninguno."),
    "card62" : MessageLookupByLibrary.simpleMessage("DERECHO: Compasivo, afectuoso, emocionalmente estable, intuitivo, fluido\n\nINVERTIDA: Sentimientos internos, autocuidado, amor propio, codependencia\n\nLa Reina de Copas es una mujer hermosa e introspectiva que se sienta en un trono a la orilla del mar. En sus manos, sostiene una copa dorada adornada con asas con forma de ángeles. A diferencia de la mayoría de las copas en el corte de Copas, esta copa está cerrada, lo que demuestra que los pensamientos y sentimientos de la Reina provienen de su mente subconsciente y de las profundidades de su alma.\n\nSe sienta sobre un trono de piedra decorado con imágenes de ninfas de mar, peces y conchas de vieira. El mar y los peces son símbolos de la mente inconsciente, y el agua representa la emoción, el espíritu y la percepción. Un cielo azul claro y sin nubes y el agua plácida del mar la rodean. Sus pies no tocan el agua; descansan sobre guijarros de colores en la orilla. Es como si ella estuviera conectada con sus emociones (representadas por el agua), pero no abrumada por ellas."),
    "card63" : MessageLookupByLibrary.simpleMessage("DERECHO: Emocionalmente equilibrado, compasivo, diplomático\n\nINVERTIDA: Autocompasión, sentimientos internos, mal humor, emocionalmente manipulador\n\nEl Rey de Copas se sienta en un gran trono de piedra y usa una túnica azul y una capa dorada, un símbolo de su autoridad y estatus. Un pequeño amuleto de pescado cuelga de su cuello simbolizando su creatividad. En su mano derecha, sostiene una copa que representa las emociones, y su izquierda tiene un cetro que muestra poder y control. A diferencia de las otras cartas de la corte de Copas, él no mira su copa y parece estar enfocado en otra parte; quizás ya haya dominado su ser emocional y no necesite concentrarse tanto en esta faceta de sí mismo.\n\nEl Rey de Copas parece estar flotando en un bloque de granito en medio de un mar turbulento. Detrás de él, a su derecha, un pez salta del océano, mientras que a la izquierda, un barco navega constantemente a pesar de las olas. Estas imágenes muestran que este Rey se mantiene tranquilo y equilibrado, incluso en condiciones turbulentas, y ha aprendido a mantenerse abierto a sus emociones e impulsos inconscientes, sin sentirse abrumado por ellas. Mantiene el poder y el control mientras equilibra sus sentimientos."),
    "card64" : MessageLookupByLibrary.simpleMessage("DERECHO: Avances, nuevas ideas, claridad mental, éxito\n\nINVERTIDA: Claridad interior, repensar una idea, juicio nublado\n\nEl As de Espadas muestra una mano brillante que aparece de una nube blanca, una representación de lo Divino. Tiene una espada vertical, simbólica de la mente y el intelecto, y en la punta de la espada se encuentra una corona cubierta con guirnalda, un signo de éxito y victoria. Si bien este as es una señal de triunfo, las montañas irregulares en el fondo sugieren que el camino por delante será un desafío. Necesitarás resistencia mental para navegar por este camino."),
