    "card7" : MessageLookupByLibrary.simpleMessage("DERECHO: Control, fuerza de voluntad, éxito, acción, determinación\n\nINVERTIDA: Autodisciplina, oposición, falta de dirección\n\nLa carta del Tarot El Carro muestra a un valiente guerrero parado dentro de un carro. Lleva una armadura decorada con lunas crecientes (que representan lo que está surgiendo), una túnica con un cuadrado (la fuerza de la voluntad) y otros símbolos alquímicos (transformación espiritual). La corona de laurel y estrella señala la victoria, el éxito y la evolución espiritual. Aunque parece conducir el carro, el auriga no tiene riendas, solo una varita como la del Mago, lo que simboliza que controla a través de la fuerza de su voluntad y mente.\n\nEl auriga se mantiene erguido: no hay forma de sentarse para este tipo, ya que se trata de tomar medidas y avanzar. Sobre su cabeza hay un dosel de estrellas de seis puntas, lo que sugiere su conexión con el mundo celestial y la voluntad Divina. Frente al carro se sienta una esfinge negra y blanca, que representa la dualidad, positiva y negativa y, a veces, fuerzas opuestas. Tenga en cuenta cómo las esfinges están tirando en direcciones opuestas, pero el auriga usa su fuerza de voluntad y su absoluta resolución para dirigir el carro hacia adelante en la dirección que desea.\n\nDetrás del carro fluye un río ancho, simbólico de la necesidad de estar \"en flujo\" con el ritmo de la vida al tiempo que avanza hacia sus objetivos e intenciones."),
