    "card8" : MessageLookupByLibrary.simpleMessage("DERECHO: Fuerza, coraje, persuasión, influencia, compasión\n\nINVERTIDA: Fuerza interior, dudas, poca energía, emoción cruda\n\nEn la carta de La Fuerza, una mujer acaricia suavemente a un león en la frente y la mandíbula. Aunque es conocida por su ferocidad, la mujer ha domesticado a esta bestia salvaje con su energía calmante y amorosa. El león es un símbolo de pasiones y deseos crudos, y al domesticarlo, la mujer muestra que el instinto animal y la pasión cruda se pueden expresar de manera positiva cuando se aplican la fuerza interna y la resistencia. Ella no usa la fuerza o la coerción; ella canaliza su fuerza interior para someter y controlar sutilmente al león.\n\nLa mujer usa una túnica blanca, que muestra su pureza de espíritu, y un cinturón y una corona de flores que representan la expresión más plena y hermosa de la naturaleza. Sobre su cabeza está el símbolo del infinito, que representa su infinito potencial y sabiduría."),
    "card9" : MessageLookupByLibrary.simpleMessage("DERECHO: Búsqueda del alma, introspección, estar solo, guía interna\n\nINVERTIDA: Aislamiento, soledad, abstinencia\n\nEl Ermitaño está solo en la cima de una montaña. El rango nevado simboliza su dominio espiritual, crecimiento y realización. Él ha elegido este camino de autodescubrimiento y, como resultado, ha alcanzado un elevado estado de conciencia.\n\nEn su mano derecha, sostiene una linterna con una estrella de seis puntas adentro; Es el Sello de Salomón, un símbolo de sabiduría. Mientras el Ermitaño camina por su camino, la lámpara ilumina su camino, pero solo ilumina sus próximos pasos en lugar del viaje completo. Debe dar un paso adelante para ver a dónde ir después, sabiendo que no todo se revelará a la vez. En su mano izquierda, el lado de la mente subconsciente, el Ermitaño tiene un largo bastón (un signo de su poder y autoridad), que utiliza para guiarse y equilibrarse."),
